import { NavLink } from "react-router-dom";
import "./Dialogs.scss"

const DialogItem=(props)=>{
  return(
    <li> <NavLink activeClassName="activeLinkDialogs" to="/dialogs/1">Андрей</NavLink> </li>
  );
}

const Dialogs=()=>{
    return(<div className="Dialogs">
    <h3>Dialogs</h3>
    <ul>
      
      <li> <NavLink activeClassName="activeLinkDialogs" to="/dialogs/2">Вадим</NavLink>   </li>
      <li> <NavLink activeClassName="activeLinkDialogs" to="/dialogs/3">Саня</NavLink> </li>
      <li> <NavLink activeClassName="activeLinkDialogs" to="/dialogs/4">Димас</NavLink></li>
      <li><NavLink activeClassName="activeLinkDialogs" to="/dialogs/6">Даник</NavLink> </li>
      <li><NavLink activeClassName="activeLinkDialogs" to="/dialogs/7">Антон</NavLink> к</li>
      <li> <NavLink activeClassName="activeLinkDialogs" to="/dialogs/8">Владос</NavLink> </li>
      <li><NavLink activeClassName="activeLinkDialogs" to="/dialogs/9" >Лёха</NavLink></li>
      <li><NavLink activeClassName="activeLinkDialogs" to="/dialogs/10">Паша</NavLink></li>
      <li><NavLink activeClassName="activeLinkDialogs" to="/dialogs/11">Егор</NavLink></li>
      <li><NavLink activeClassName="activeLinkDialogs" to="/dialogs/12">Ваня</NavLink></li>
      <li><NavLink activeClassName="activeLinkDialogs" to="/dialogs/13">какой-то ноунейм</NavLink></li>
    </ul>
    </div>
    );
}

export default Dialogs
